import Link from "next/link";
import Router from 'next/router'

const Cards = (props) => {
  return (
    <div>
      {props.results.map((data, index) => {
        return (
          <div className="card" style={{ width: "18rem" }} key={index}>
            <img src={data.image} className="card-img-top" alt={data.name} />
            <div className="card-body">
              <h5 className="card-title">Nombre: {data.name}</h5>
              
                  <a className="btn btn-primary" onClick={e=> Router.push(`/${props.route}/[id]`, `/${props.route}/${user.id}`)}>
                    Go somewhere
                  </a>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Cards;
